import axios from "axios";
import { useEffect, useState } from "react";
import { createTable, useTableInstance } from '@tanstack/react-table'

const psi_url = "https://api.data.gov.sg/v1/environment/psi";

type Response = {
    metric: String,
    national: Number,
    central: Number,
    west: Number,
    east: Number,
    north: Number,
    south: Number
}

// const table = createTable().setRowType<Response>();  

export default function ReactTable() {
    const [data, setData] = useState([]);

    const fetchData = async () => {
        const response = await axios.get(psi_url).catch(err => console.log(err));

        if (response) {
            console.log(response.data.items[0].readings.keys)
        }
    };

    useEffect(() => {
        fetchData();
    }, []);   

    return (
        <div>

        </div>
    )
}
